    return (
        <div className="full-container todo-card">
            <div className="card-header">
                <h2 className="second-header">Historia</h2>
                <p>21.22.2023</p>

            </div>
            <div className="card-body">


            </div>
            <div className="card-buttons">
                <TodoCardOption />
                <TodoCardOption />
                <TodoCardOption />
            </div>

        </div>
    )
}


const TodoCardOption = ({type}) =>  {
    return (
        <div className="todo-card-option full-container flex-center">
            {type === "trash" ?
                <ion-icon name="trash"></ion-icon>
                :
                type === "add" ? 
                <ion-icon name="add-outline"></ion-icon>
                :
                type 


            }
        </div>
    );
}

export default TodoCard;
